(10,'artikel_thumbs/5vtQ20noZ2jUP8owIJN1gAFTxqFiB9VhYd5dUiWK.png','Pentingnya Kesehatan Mental bagi Remaja dan Cara Menghadapinya','<p>Masa remaja adalah masa yang penting dalam pembentukan generasi akan datang yang sehat, tangguh, dan produktif. Untuk mewujudkannya, menjaga kesehatan fisik saja tidak cukup. Kesehatan mental remaja juga memainkan peranan penting dalam menentukan kualitas hidup dan kesejahteraan mereka.&nbsp;</p><p>&nbsp;</p><p>Namun, akhir-akhir ini masalah kesehatan mental di kalangan remaja semakin meningkat. Sebuah <a href=\"https://rsj.acehprov.go.id/berita/kategori/artikel/krisis-kesehatan-mental-menghantui-generasi-z-indonesia\">survei</a> yang dilakukan oleh I-NAMHS (Indonesia National Adolescent Mental Health Survey) tahun 2022&nbsp;menunjukkan sebanyak 15.5 juta atau sekitar 34.9% remaja mengalami masalah kesehatan mental. Kemudian, data dari <a href=\"https://www.who.int/news-room/fact-sheets/detail/adolescent-mental-health\">WHO</a> juga menunjukkan 1 di antara 7 anak berusia 10-19 tahun mengalami masalah kesehatan mental.</p><h2><strong>Peran Kesehatan Mental dalam Perkembangan Remaja</strong></h2><p>Kesehatan mental yang baik dapat membantu remaja tumbuh kembang secara optimal, secara emosional, fisik dan sosial. Beberapa <a href=\"https://raisingchildren.net.au/pre-teens/mental-health-physical-health/about-mental-health/teen-mental-health\">alasan</a> pentingnya kesehatan mental yang baik bagi remaja adalah sebagai berikut:</p><p><strong>1. Membantu Membangun Hubungan yang Sehat&nbsp;</strong></p><p>Kesehatan mental yang baik membuat remaja mampu membangun hubungan yang kuat dengan keluarga, teman dan orang-orang di sekitarnya, serta menjadi bagian dari komunitas.</p><p><strong>2. Membantu Beradaptasi</strong></p><p>Mereka akan mampu beradaptasi dengan perubahan dan berbagai tantangan hidup. Mereka bisa bangkit kembali dari rasa kecewa dan kesal.&nbsp;</p><p><strong>3. Memiliki Rasa Percaya Diri Tinggi</strong></p><p>Mereka lebih menikmati hidup, merasa bahagia dengan dirinya sendiri, serta memiliki sikap positif dan rasa pencapaian.</p><p><strong>4. Mendukung Kesehatan Fisik</strong></p><p>Mereka akan menjadi lebih aktif dan sehat serta cukup beristirahat, sehingga mampu berkonsentrasi saat belajar, yang akan mendukung keberhasilannya dalam menyelesaikan pendidikan.</p><h2><strong>Tanda-tanda Masalah Kesehatan Mental pada Remaja</strong></h2><p>Gejala gangguan kesehatan mental seringkali diabaikan, karena dianggap sebagai perubahan yang normal terjadi di masa pubertas. Padahal, jika tidak ditangani dengan baik sejak dini, gejala-gejala umum ini bisa bertambah parah dan menjadi gejala gangguan kejiwaan yang berat, yang bahkan bisa berujung pada perilaku menyakiti diri atau bunuh diri.</p><p>Berikut adalah tanda-tanda masalah kesehatan mental pada remaja, yang harus diwaspadai oleh orang tua dan orang lain di sekitarnya:</p><h3><strong>1. Kesulitan Mengendalikan Emosi</strong></h3><p>Remaja yang kesehatan mentalnya terganggu mengalami kesulitan mengelola emosinya. Ia menjadi lebih sensitif, bisa marah meledak-ledak atau merasa sedih berlebihan tanpa alasan yang jelas.&nbsp;</p><h3><strong>2. Mengalami Perubahan Perilaku</strong></h3><p>Jika anak remaja tiba-tiba mudah tersinggung, mengamuk, memberontak atau berperilaku seperti anak kecil, bisa saja ini merupakan tanda-tanda masalah kesehatan mental. Ia mungkin juga kehilangan minat terhadap hal-hal yang biasa ia lakukan, seperti pergi ke sekolah atau bermain bersama teman.</p><h3><strong>3. Menarik Diri dari Lingkungan Sosial</strong></h3><p>Tanda gangguan kesehatan mental lainnya adalah anak akan merasa cemas berlebihan saat berada di antara orang lain, dan takut terhadap penolakan, sehingga cenderung menarik diri dan menghindar dari keramaian.</p><h3><strong>4. Kehilangan Rasa Percaya Diri</strong></h3><p>Masalah kesehatan mental juga dapat membuat anak remaja merasa tidak berharga dan menyalahkan dirinya sendiri. Untuk mengembalikan rasa percaya dirinya, anak kadang melampiaskannya dengan melakukan hal-hal buruk, seperti merokok, mengkonsumsi minuman beralkohol atau obat-obatan terlarang.</p><h3><strong>5. Prestasi Menurun</strong></h3><p>Hilangnya minat terhadap sekolah dan aktivitas lainnya dapat mengganggu kemampuannya belajar. Kondisi ini juga akan melemahkan kemampuan kognitifnya, seperti berpikir, mengingat, dan memecahkan masalah, sehingga prestasinya di sekolah akan menurun.</p><h3><strong>6. Gangguan Makan dan Tidur</strong></h3><p>Anak remaja yang terganggu kesehatan mentalnya dapat mengalami perubahan pola tidur, seperti susah tidur atau sebaliknya tidur berlebihan. Kebiasaan makan pun bisa berubah, seperti kehilangan nafsu makan, atau justru makan berlebihan (stress eating), sehingga membuatnya berpotensi mengalami obesitas.</p><h3><strong>7. Gangguan Fisik</strong></h3><p>Beberapa keluhan fisik yang bisa ditimbulkan oleh masalah kesehatan mental, antara lain sakit kepala, nyeri otot, sakit perut, sakit punggung, tidak bersemangat dan bertenaga.</p><p>&nbsp;</p><h2><strong>Mekanisme Koping Remaja dalam Menghadapi Stres</strong></h2><p>Setiap orang memiliki strategi atau mekanisme koping (coping mechanism) saat mengalami stress, keadaan tertekan atau emosi yang negatif. Mekanisme koping ini membantu remaja mengatasi ketidaknyamanan dari berbagai perasaan negatif yang dialaminya, agar keseimbangan emosional tetap terjaga dan remaja dapat belajar beradaptasi dengan setiap perubahan yang dihadapinya.</p><p>Mekanisme koping ini ada yang bersifat negatif, seperti makan berlebihan (stress eating), merokok, mengkonsumsi minuman beralkohol dan obat-obatan terlarang atau belanja secara impulsif (impulsive buying). Bagaimana mekanisme koping yang efektif agar remaja dapat mengelola stress dan emosi negatifnya dengan sehat? Berikut cara-caranya:</p><h3><strong>1. Mengenali Penyebab Masalah</strong></h3><p>Dengan mengetahui penyebab stres atau emosi yang dirasakannya, remaja dapat membuat keputusan dan tindakan yang tepat, seperti mencari bantuan atau konseling, mengakhiri hubungan dengan orang yang menjadi sumber perasaan negatif, atau menetapkan batasan bagi diri sendiri.</p><h3><strong>2. Berolahraga&nbsp;</strong></h3><p>Olahraga seperti bersepeda, jogging, berenang, atau yoga dapat membantu membuat perasaan lebih rileks dan nyaman.&nbsp;</p><h3><strong>3. Melakukan Hobi&nbsp;&nbsp;</strong></h3><p>Menekuni hobi seperti melukis, menari atau bermain musik juga dapat membantu remaja mengekspresikan diri dan perasaannya.&nbsp;</p><h3><strong>4. Journaling</strong></h3><p>Membuat jurnal tentang pikiran dan perasaan yang dialami, serta mencatat hal-hal yang perlu dilakukan dapat membantu remaja lebih fokus terhadap tindakan yang harus dilakukannya.&nbsp;</p><h3><strong>5. Self Care</strong></h3><p>Merawat diri, beristirahat cukup dan melakukan relaksasi seperti yoga dan menditasi dapat membantu remaja membangun pikiran positif dan kepercayaan diri, serta memaafkan orang atau hal-hal yang menyakitinya.</p><h3><strong>6. Melakukan Aktivitas yang Disukai</strong></h3><p>Bermain dengan hewan peliharaan, traveling ke tempat-tempat baru, masak makanan yang disukai, atau berkebun dapat mengalihkan pikiran dari hal-hal negatif, serta membantu remaja lebih mencintai diri dan hal-hal di sekitarnya.&nbsp;</p><p>&nbsp;</p><h2><strong>Meningkatkan Kesadaran Pentingnya Kesehatan Mental</strong></h2><p>Orang tua memainkan peranan penting dalam mendukung kesehatan mental anak remaja. Orang tua seharusnya menjadi orang pertama yang sadar, jika anak sedang mengalami gangguan kesehatan mental.&nbsp;</p><p>Orang tua harus terlibat dalam kehidupan anak, serta terus menunjukkan cinta, kasih sayang dan perhatian pada mereka. Dorong komunikasi yang terbuka, agar anak berani menceritakan permasalahannya kepada orang tua dan menemukan jalan keluarnya bersama-sama. Beri pujian dan apresiasi atas pencapaian anak agar ia lebih percaya diri.&nbsp;</p><p>Selain orang tua dan keluarga, sekolah dan masyarakat juga berperan dalam meningkatkan kesadaran terhadap pentingnya kesehatan mental bagi remaja. Saat ini, ada banyak program dan inisiatif, yang dilakukan oleh sekolah, kampus, pemerintah, maupun institusi global seperti <a href=\"https://www.unicef.org/indonesia/id/coronavirus/materi-kie-untuk-remaja-terkait-kesehatan-mental\">UNICEF</a> yang bisa diikuti oleh remaja dan orang tua untuk mendukung kesejahteraan mental para remaja.</p><p>Janganlah segan membicarakan masalah kesehatan mental, serta mencari bantuan jika melihat atau mengalami gangguan kesehatan mental. Keterbukaan merupakan kunci untuk mengatasi masalah kesehatan mental remaja secara lebih cepat.</p>',12,'2025-10-22 22:30:25','2025-10-22 22:30:25'),
(11,'artikel_thumbs/j3KlyN43Qkjh4nQ9r9ANGtz86jsSCTKfQEaSfG17.jpg','Mengenal Anxiety yang mengganggu dan Berbagai Jenisnya','<p><strong>Rasa cemas atau </strong><i><strong>anxiety</strong></i><strong> adalah hal yang normal dirasakan ketika seseorang menghadapi situasi atau mendengar berita yang menimbulkan rasa takut atau khawatir. Namun, </strong><i><strong>anxiety</strong></i><strong> perlu diwaspadai jika muncul tanpa sebab atau sulit dikendalikan, karena bisa jadi hal tersebut disebabkan oleh gangguan kecemasan.</strong></p><p><a href=\"https://www.alodokter.com/kenali-tiga-jenis-gangguan-kecemasan-dan-gejalanya\">Gangguan kecemasan</a> dan <i>anxiety</i> tidaklah sama. Rasa cemas terbilang normal apabila masih terkendali dan hilang setelah faktor pemicu munculnya rasa cemas teratasi.</p><p>Namun, jika perasaan cemas menetap, bahkan memburuk hingga akhirnya mengganggu aktivitas sehari-hari, kondisi tersebut dapat dikatakan sebagai gangguan kecemasan (<i>anxiety disorder</i>).</p><p>&nbsp;</p><h3><strong>Ketahui Berbagai Gejala </strong><i><strong>Anxiety</strong></i></h3><p>Setiap orang dapat merasa cemas ketika hendak menghadapi atau sedang berada dalam situasi yang dirasakan mengancam atau menakutkan.</p><p>Beberapa contoh situasi tersebut adalah pindah sekolah, memulai pekerjaan baru, akan menjalani operasi, menghadapi ujian, mengalami musibah, atau menunggu istri yang akan melahirkan.</p><p>Munculnya rasa cemas karena harus berhadapan dengan situasi atau keadaan yang dianggap dapat menimbulkan stres adalah hal yang normal. Orang yang cemas biasanya akan merasakan&nbsp;<a href=\"https://www.alodokter.com/ciri-ciri-anxiety-kenali-tandanya-sejak-dini\">ciri-ciri anxiety</a> berikut ini:</p><ul><li>Gugup, gelisah, dan tegang</li><li>Detak jantung cepat</li><li>Napas cepat</li><li>Gemetaran</li><li>Sulit atau bahkan tidak bisa tidur</li><li>Banyak berkeringat</li><li><a href=\"https://www.alodokter.com/duh-badan-lemas-terus-menghampiri-kenali-penyebabnya\">Tubuh terasa lemas</a></li><li>Sulit konsentrasi</li><li>Adanya perasaan seperti akan ditimpa bahaya</li></ul><p>&nbsp;</p><h3><strong>Membedakan </strong><i><strong>Anxiety </strong></i><strong>Normal dengan </strong><i><strong>Anxiety</strong></i><strong> yang Berbahaya</strong></h3><p>Cemas atau <i>anxiety</i> tidak selalu merupakan hal yang buruk. Dengan <a href=\"https://www.alodokter.com/bebas-dari-penyakit-berkat-berpikir-positif\">pikiran positif</a>, rasa cemas yang muncul dapat dijadikan motivasi atau dorongan untuk dapat mengatasi tantangan atau situasi tertentu.</p><p>Sebagai contoh, saat akan ujian atau wawancara kerja, rasa cemas mungkin bisa membuat Anda termotivasi untuk belajar atau mempersiapkan wawancara kerja dengan sebaik-baiknya.</p><p>Hal yang perlu diwaspadai adalah ketika rasa cemas tetap muncul meski faktor pemicunya sudah hilang, atau perasaan cemas muncul tanpa alasan jelas dan mengganggu aktivitas. Dalam hal ini, Anda patut mencurigai adanya gangguan kecemasan.</p><p>Gejala <i>anxiety</i> yang dirasakan dapat berbeda pada tiap orang, tergantung pada jenis gangguan kecemasan yang diderita. Untuk menentukan apakah <i>anxiety</i> yang muncul terbilang normal atau disebabkan oleh&nbsp;<a href=\"https://www.alodokter.com/kesehatan-mental\">gangguan mental</a>, perlu dilakukan pemeriksaan lebih lanjut oleh psikolog atau psikiater.</p><p>&nbsp;</p><h3><strong>Beberapa Jenis Anxiety yang Perlu Anda Ketahui</strong></h3><p>Berikut ini adalah jenis-jenis <i>anxiety disorder</i> atau gangguan kecemasan beserta gejalanya:</p><h4><strong>1. Gangguan kecemasan umum (</strong><i><strong>generalized anxiety disorder</strong></i><strong>)</strong></h4><p>Seseorang yang menderita <a href=\"https://www.alodokter.com/gangguan-kecemasan-umum\">gangguan kecemasan umum</a> bisa merasa khawatir atau <a href=\"https://www.alodokter.com/kecemasan-berlebihan-kenali-gejala-serta-cara-efektif-mengatasinya\">cemas&nbsp;berlebihan</a> secara terus-menerus&nbsp;terhadap berbagai hal, mulai dari pekerjaan, kesehatan, hingga hal-hal yang sederhana dan wajar terjadi sehari-hari, seperti berinteraksi dengan orang lain.</p><p><i>Anxiety</i> yang muncul akibat gangguan kecemasan umum bisa dirasakan setiap hari dan menetap hingga lebih dari 6 bulan. Akibatnya, penderita gangguan kecemasan ini akan menjadi sulit menjalani aktivitas dan pekerjaan sehari-hari.</p><p>Selain munculnya rasa cemas yang mengganggu, penderita gangguan kecemasan umum juga dapat merasa cepat lelah, tegang, mual, sakit kepala, sulit berkonsentrasi, sesak, dan <a href=\"https://www.alodokter.com/insomnia\">insomnia</a>.</p><h4><strong>2. Fobia</strong></h4><p><a href=\"https://www.alodokter.com/fobia\">Fobia</a> merupakan jenis gangguan <i>anxiety</i> yang membuat penderitanya memiliki rasa takut yang berlebihan dan cenderung tidak rasional terhadap suatu benda, binatang, atau situasi tertentu.</p><p>Orang yang memiliki fobia bisa mengalami serangan panik atau rasa takut yang hebat ketika melihat sesuatu atau berada di tempat yang menjadi pemicu fobia, misalnya laba-laba, darah, berada di tengah <a href=\"https://www.alodokter.com/memahami-fobia-keramaian-dan-penanganannya\">keramaian</a>, <a href=\"https://www.alodokter.com/kenali-fobia-gelap-dan-cara-mengatasinya\">tempat yang gelap</a>, tempat tinggi, atau ruangan tertutup.</p><p>Oleh karena itu, penderita fobia biasanya akan melakukan segala upaya untuk menjauhkan dirinya dari hal atau situasi yang ia takuti.</p><h4><strong>3. Gangguan kecemasan sosial</strong></h4><p>Penderita gangguan kecemasan sosial atau&nbsp;<a href=\"https://www.alodokter.com/gangguan-kecemasan-sosial\">fobia sosial</a> memiliki kecemasan atau ketakutan yang luar biasa terhadap lingkungan sosial atau situasi ketika harus berinteraksi dengan orang lain.</p><p>Penderita fobia ini selalu merasa diawasi dan dinilai oleh orang lain, serta takut atau merasa malu secara berlebihan saat berada di keramaian.</p><p>Hal-hal tersebut membuat penderita selalu berusaha menghindari situasi yang mengharuskan ia bertemu atau berinteraksi dengan banyak orang.</p><h4><strong>4. PTSD (</strong><i><strong>post-traumatic stres disorder</strong></i><strong>)</strong></h4><p>Gangguan stres pascatrauma atau PTSD dapat muncul pada seseorang yang pernah mengalami kejadian traumatis atau berada di situasi berbahaya yang mengancam nyawa. Contohnya, tinggal di daerah konflik atau perang, terkena bencana alam, atau korban kekerasan.</p><p>Orang yang menderita <a href=\"https://www.alodokter.com/ptsd\">PTSD</a> sering kali susah untuk melupakan pengalaman traumatisnya, baik terlintas dalam benak atau saat bermimpi, yang kemudian membuatnya merasa bersalah, terisolasi, dan sulit bersosialisasi dengan orang lain.</p><p>Terkadang orang yang memiliki PTSD juga bisa mengalami insomnia dan bahkan depresi.</p><h4><strong>5. Gangguan panik</strong></h4><p>Penderita <a href=\"https://www.alodokter.com/gangguan-panik\">gangguan panik</a> yang bisa merasa takut atau panik tanpa alasan yang jelas.&nbsp;<i>Anxiety</i> dan serangan panik akibat gangguan ini dapat muncul kapan saja dan terjadi secara tiba-tiba atau berulang.</p><p>Ketika gejala panik muncul, penderita gangguan panik biasanya dapat merasakan sejumlah gejala lain, seperti jantung berdebar-debar, keringat dingin, pusing, sesak napas, serta tubuh gemetar dan terasa lemas.</p><p>Orang dengan gangguan panik tidak dapat memprediksi kapan gangguan tersebut akan muncul atau apa pemicunya. Oleh karena itu, tak sedikit penderita gangguan panik yang menjauhkan diri dari lingkungan sosial karena takut serangan paniknya kambuh di tempat umum.</p><p><strong>6. Gangguan obsesif kompulsif (OCD)</strong></p><p>Orang yang menderita&nbsp;<a href=\"https://www.alodokter.com/ocd\">gangguan OCD</a> memiliki kecenderungan untuk melakukan sesuatu secara berulang-ulang untuk meringankan rasa cemas yang berasal dari pikirannya sendiri, contohnya, <a href=\"https://www.alodokter.com/cuci-tangan-dulu\">mencuci tangan</a> harus sebanyak 3 kali karena berpikir tangannya masih kotor.</p><p>Gangguan ini sulit dikendalikan, bersifat menetap, dan dapat kambuh kapan saja sehingga membuat penderitanya terganggu untuk melakukan aktivitas sehari-hari.</p><p>&nbsp;</p><h3><strong>Beberapa Cara Mengatasi </strong><i><strong>Anxiety</strong></i></h3><p>Untuk meredakan atau mencegah munculnya perasaan cemas, Anda dapat melakukan beberapa cara berikut ini:</p><ul><li>Mencukupi waktu tidur dan istirahat</li><li>Membatasi konsumsi kafein dan minuman beralkohol</li><li><a href=\"https://www.alodokter.com/ternyata-tidak-sulit-mengatasi-stres\">Mengurangi stres</a> dengan mencoba teknik relaksasi, misalnya meditasi dan yoga</li><li>Melakukan aktivitas fisik atau berolahraga secara teratur</li><li>Mencoba bertukar pikiran atau <a href=\"https://www.alodokter.com/suka-curhat-dengan-sahabat-membuatmu-makin-sehat\">curhat dengan teman</a></li></ul><p>Jika cara-cara di atas sudah dilakukan dan faktor pemicu <i>anxiety</i> juga sudah teratasi, tetapi rasa cemas belum juga hilang, sebaiknya konsultasikan ke psikiater. Untuk menentukan penyebab dan jenis gangguan kecemasan yang Anda alami, psikiater akan melakukan <a href=\"https://www.alodokter.com/ketahui-apa-itu-pemeriksaan-medis-kejiwaan\">pemeriksaan psikologis</a>.</p><p>Apabila hasil pemeriksaan tersebut menunjukkan bahwa Anda mengalami gangguan kecemasan, psikiater akan mengatasi <i>anxiety </i>yang Anda rasakan dengan psikoterapi dan konseling, serta pemberian <a href=\"https://www.alodokter.com/waspada-penggunaan-obat-penenang-untuk-mengatasi-susah-tidur\">obat penenang</a> bila memang dibutuhkan.</p><p><i>Anxiety</i> yang muncul akibat gangguan kecemasan lama-kelamaan berpotensi membuat penderitanya merasa depresi, <a href=\"https://www.alodokter.com/percobaan-bunuh-diri\">ingin bunuh diri</a>, hingga menyalahgunakan obat-obatan atau minuman beralkohol. Oleh karena itu, jika Anda mengalaminya, segeralah <a href=\"https://www.alodokter.com/cari-dokter/dokter-jiwa\">berkonsultasi ke psikiater</a>.</p><p><i>Anxiety</i> yang muncul akibat gangguan kecemasan lama-kelamaan berpotensi membuat penderitanya merasa depresi, <a href=\"https://www.alodokter.com/percobaan-bunuh-diri\">ingin bunuh diri</a>, hingga menyalahgunakan obat-obatan atau minuman beralkohol.</p><p>Oleh karena itu, jika Anda mengalami rasa cemas yang berkepanjangan, sebaiknya konsultasikan lebih lanjut dengan <a href=\"https://www.alodokter.com/cari-dokter/dokter-jiwa\">psikiater</a> untuk mendapatkan penanganan yang sesuai.</p>',12,'2025-10-22 22:34:19','2025-10-22 22:34:19'),
(12,'artikel_thumbs/rlok5WFmJX8KxMdCIcqOIblbZq22SOwjbFRafLgt.jpg','Apa Itu Skizofrenia?','<p>Skizofrenia adalah gangguan mental serius yang memengaruhi cara seseorang berpikir, merasa, dan berperilaku, yang sering ditandai dengan halusinasi, delusi, dan kekacauan berpikir. Kondisi kronis ini memengaruhi sekitar 24 juta orang di seluruh dunia, dan meskipun gejalanya dapat dikendalikan dengan penanganan yang tepat, skizofrenia sering kali disalahpahami dan dapat menyebabkan komplikasi seperti depresi, kecanduan alkohol, dan peningkatan risiko kematian dini karena penyakit lain.&nbsp;</p><p>Gejala skizofrenia</p><ul><li><p><strong>Gejala awal (prodromal):</strong></p><p>Menarik diri dari sosial, mengurangi pembicaraan, kesulitan menjaga kebersihan diri, dan menarik diri dari aktivitas.</p></li></ul>',12,'2025-10-22 22:38:23','2025-10-22 22:38:23');
